import React from 'react';

const AboutMe = ({ name, phone, email, city, photo }) => {
  return (
    <div className="about-me">
      <h2>About Me</h2>
      <img src={photo} alt="Profile" />
      <p>Name: {name}</p>
      <p>Phone: {phone}</p>
      <p>Email: {email}</p>
      <p>City: {city}</p>
    </div>
  );
};

export default AboutMe;
